import {NodePath as axios} from "@babel/traverse";

export default function fetchStockDataIEX(ticker){

let requestString = 'https://sandbox.iexapis.com/stable/stock/'+ticker+'/price?token=Tsk_b7a45cc65e624a55a5688d15eac1b692';

        myJson = axios.get(requestString).then(response => {

            console.log(response.data);
            return response.data;

        }).catch(error => console.error(error));
        var price = myJson.price;

    let data = {"Symbol":ticker,"price":price,"open":21,"close":21};

    return data;


}
